var query = `INSERT INTO storagePosition (
            pos_11, pos_12, pos_13, pos_14, pos_15,
            pos_21, pos_22, pos_23, pos_24, pos_25,
            pos_31, pos_32, pos_33, pos_34, pos_35,
            pos_41, pos_42, pos_43, pos_44, pos_45,
            pos_51, pos_52, pos_53, pos_54, pos_55) VALUES`;
var variables =`(`;

for (let i = 0; i < 25; i++) {

    variables += msg.payload.split(',')[i];
    if (i < 24) {
        variables +=',';
    }
}
variables += ')';
msg.topic = query + variables
return msg;

msg.totalRecords = msg.payload.total_records;
msg.usagePercentage = []; 

for (let i = 11; i <= 55; i++)
 {
    let key = `percent_pos_${i}`;
    if (msg.payload.hasOwnProperty(key)) 
    {
        msg.usagePercentage.push({
            position: key,
            percentage: msg.payload[key]
        });
    }
}
return msg;

let slots = msg.payload.split(',').map(item => item.trim());
let color = [];

for (let i = 0; i < 25; i++) {
    if (slots[i] == '1') {
        color[i] = "green"
    }
    else {
        color[i] = "white"
    }
}
return { payload: color };

